    vector<int> P;
    vector<int> remaining = a;
    priority_queue<int, vector<int>, greater<int>> pq;

    for (int i = 1; i <= K; ++i) {
        if (remaining[i - 1] > 0) {
            pq.push(i);
        }
    }

    while (!pq.empty()) {
        int current = pq.top();
        pq.pop();

        P.push_back(current);
        remaining[current - 1]--;

        if (remaining[current - 1] > 0) {
            pq.push(current);
        }

        bool valid = true;
        for (int i = 1; i <= K; ++i) {
            if (remaining[i - 1] == 0) {
                valid = false;
                break;
            }
