        if (valid) {
            for (int i = 1; i <= K; ++i) {
                if (remaining[i - 1] > 0) {
                    pq.push(i);
                }
            }
        } else {
            set<int> temp;
            for (int i = max(0, (int)P.size() - K); i < P.size(); ++i) {
                temp.insert(P[i]);
            }
            if (temp.size() != K) {
                return {};
            }
        }
    }

    for (int num : remaining) {
        if (num != 0) {
            return {};
        }
    }

    return P;
