public class SequenceSolver {
    public static int[] findSequence(int K, int[] counts) {
        int[] result = new int[Arrays.stream(counts).sum()];
        boolean[] used = new boolean[K + 1];

        if (backtrack(result, 0, K, counts, used)) {
            return result;
        }

        return new int[0];
    }

    private static boolean backtrack(int[] result, int index, int K, int[] counts, boolean[] used) {
        if (index == result.length) {
            return true;
        }

        for (int num = 1; num <= K; num++) {
            if (counts[num - 1] > 0 && isValidPlacement(result, index, num, K)) {
                result[index] = num;
                counts[num - 1]--;
                used[num] = true;

                if (backtrack(result, index + 1, K, counts, used)) {
                    return true;
                }

                result[index] = 0;
                counts[num - 1]++;
                used[num] = false;
            }
        }

        return false;
    }

    private static boolean isValidPlacement(int[] result, int index, int num, int K) {
        if (index < K - 1) {
            return true;
        }

        int[] subsequence = new int[K];
        for (int i = 0; i < K; i++) {
            subsequence[i] = result[index - K + 1 + i];
        }
        subsequence[K - 1] = num;

        Arrays.sort(subsequence);
        for (int i = 0; i < K; i++) {
            if (subsequence[i] != i + 1) {
                return false;
            }
        }

        return true;
    }

